import React, { useState, useEffect } from 'react';
import { makeStyles, withTheme } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid'
import Typography from '@material-ui/core/Typography';
import { Link } from '@material-ui/core';

export default function DiaryListSection() {
    const [diaries, setDiaries] = useState([])

    async function fetchDiaries() {
        const res = await fetch("https://salvagerapi.salvagerindonesia.com/api/v1/diaries?format=json")
        const diaries = await res.json()
        console.log(diaries)
        setDiaries(diaries)
    }

    var diaryList = diaries.map((diary) => {
        return <div key={diary.toString()}>
            <Grid>
                <ItemDiary diary />
            </Grid>
        </div>
    })

    useEffect(() => {
        fetchDiaries()
    }, [])

    const classes = useStyles();

    return (
        <Grid container>
            {diaryList}
        </Grid>
    )
}


const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
    },
    details: {
        display: 'flex',
        flexDirection: 'column',
    },
    content: {
        flex: '1 0 auto',
    },
}));

function ItemDiary(props) {
    const classes = useStyles();

    return (
        <div>
            <Grid>
                <Typography>{props.headline}</Typography>

            </Grid>
        </div>
    )
}
